import React, { useState, useEffect } from 'react';
import {
  Badge,
  Card,
  CardHeader,
  CardFooter,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  DropdownToggle,
  Media,
  Progress,
  Table,
  Container,
  Row,
  Input,
  Button,
} from 'reactstrap';

import Header from 'components/Headers/Header.js';
import axios from 'axios';

const Tables = () => {
  const [comments, setComments] = useState({});
  const [scores, setScores] = useState({});
  const [papersData, setPapersData] = useState([]);

  useEffect(() => {
    const fetchPaperData = async () => {
      try {
        // Fetch paper data from the backend
        const response = await axios.get('http://192.168.1.211:5001/api/review'); // Update the URL with your backend URL
        setPapersData(response.data);
      } catch (error) {
        console.error('Error fetching paper data:', error.message);
      }
    };

    fetchPaperData();
  }, []);

  const handleCommentChange = (_id, newComment) => {
    setComments((prevComments) => {
      const updatedComments = { ...prevComments };
      updatedComments[_id] = newComment;
      return updatedComments;
    });
  };

  const handleScoreChange = (_id, newScore) => {
    setScores((prevScores) => {
      const updatedScores = { ...prevScores };
      updatedScores[_id] = newScore;
      return updatedScores;
    });
  };

  return (
    <>
      <Header />
      <Container className="mt--7" fluid>
        <Row>
          <div className="col">
            <Card className="shadow">
              <CardHeader className="border-0">
                <h3 className="mb-0">Pending Papers To Be Reviewed</h3>
              </CardHeader>
              <Table className="align-items-center table-flush" responsive>
                <thead className="thead-dark">
                  <tr>
                    <th scope="col">Paper</th>
                    <th scope="col">Application Number</th>
                    <th scope="col">Comments</th>
                    <th scope="col">Percentage</th>
                    <th scope="col">Score</th>
                    <th scope="col" />
                  </tr>
                </thead>
                <tbody>
                  {papersData.map((paper) => (
                    <tr key={paper._id}>
                      <th scope="row">
                        <Media className="align-items-center">
                          <a
                            href="#pablo"
                            onClick={(e) => e.preventDefault()}
                          />
                          <Media>
                            <span className="mb-0 text-sm">1</span>
                          </Media>
                        </Media>
                      </th>
                      <td>{paper.code}</td>
                      <td>
                        <Input
                          type="text"
                          placeholder="Enter comments"
                          value={comments[paper._id] || ''}
                          onChange={(e) => handleCommentChange(paper._id, e.target.value)}
                        />
                      </td>
                      <td>
                        <div className="d-flex align-items-center">
                          <span className="mr-2">{(scores[paper._id] || 0) * 10}%</span>
                          <div>
                            <Progress max="10" value={scores[paper._id] || 0} barClassName="bg-danger" />
                          </div>
                        </div>
                      </td>
                      <td>
                        <Input
                          type="number"
                          value={scores[paper._id] || 0}
                          onChange={(e) => handleScoreChange(paper._id, e.target.value)}
                        />
                      </td>
                      <td className="text-right">
                        <UncontrolledDropdown>
                          <DropdownToggle
                            className="btn-icon-only text-light"
                            href="#pablo"
                            role="button"
                            size="sm"
                            color=""
                            onClick={(e) => e.preventDefault()}
                          >
                            <i className="fas fa-ellipsis-v" />
                          </DropdownToggle>
                          <DropdownMenu className="dropdown-menu-arrow" right>
                          <DropdownItem
  onClick={(e) => {
    e.preventDefault();
    window.location.href = paper.driveLink; // Assuming 'paper' has the 'driveLink' property
  }}
>
  View
</DropdownItem>

                            <DropdownItem
                              href="#pablo"
                              onClick={(e) => e.preventDefault()}
                            >
                              Submit
                            </DropdownItem>
                          </DropdownMenu>
                        </UncontrolledDropdown>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </Card>
          </div>
        </Row>
      </Container>
    </>
  );
};

export default Tables;
